    @Test
//    @Tag("Hard")
    fun plusMinus() {
        assertEquals(0, plusMinus("0"))
        assertEquals(4, plusMinus("2 + 2"))
        assertEquals(6, plusMinus("2 + 31 - 40 + 13"))
        assertEquals(-1, plusMinus("0 - 1"))
    }

    @Test
//    @Tag("Hard")
    fun firstDuplicateIndex() {
        assertEquals(-1, firstDuplicateIndex("Привет"))
        assertEquals(9, firstDuplicateIndex("Он пошёл в в школу"))
        assertEquals(40, firstDuplicateIndex("Яблоко упало на ветку с ветки оно упало на на землю"))
        assertEquals(9, firstDuplicateIndex("Мы пошли прямо Прямо располагался магазин"))
        assertEquals(7, firstDuplicateIndex("It was raining raining raining hard"))
        assertEquals(7, firstDuplicateIndex("It was falling fALLing FaLlInG on the stars"))
    }

    @Test
//    @Tag("Hard")
    fun mostExpensive() {
        assertEquals("ᛩ엩禨쮹磴ꮵ烧⧄咵ᑉ駲?老躛钭蔏ስ秿Vⵤㄡ舔᎑핫㥃瓡⇀앺딷휺ꆘ仾??裱巂焞鸈ᇜ奱蕹촳㳺᭙ဠᷟꔋﱱ迚㎄矅㾝庀?꟦尯̼퇁게㸙懄䗡秽?識긞麲匌찿뾰奌䚣?ﬠᦻ쎾䎝肚䮎蠪쬊ꇫ灹嬼法욬骮䝡꣕뀹濛咾쮖魝䦮Ѡ矶妄垝鵔驥톩স햯劗₥?윚", mostExpensive("ᛩ엩禨쮹磴ꮵ烧⧄咵ᑉ駲?老躛钭蔏ስ秿Vⵤㄡ舔᎑핫㥃瓡⇀앺딷휺ꆘ仾??裱巂焞鸈ᇜ奱蕹촳㳺᭙ဠᷟꔋﱱ迚㎄矅㾝庀?꟦尯̼퇁게㸙懄䗡秽?識긞麲匌찿뾰奌䚣?ﬠᦻ쎾䎝肚䮎蠪쬊ꇫ灹嬼法욬骮䝡꣕뀹濛咾쮖魝䦮Ѡ矶妄垝鵔驥톩স햯劗₥?윚 0"))
